import Link from 'next/link';

export default function Index() {
    return (
        <div>
            <h1>Hello!</h1>
            <Link href="/about">
                <a>About</a>
            </Link>
            <Link href="/projects">
                <a>Projects</a>
            </Link>
            <Link href="/contact">
                <a>Contact</a>
            </Link>
            <img src="/static/Cara.png" alt="Cara image"/>
        </div>
    );
}
